Pack::SequenceTypeEnum Pack::toSequenceTypeEnum(const utility::string_t& value) const
{
    
    if (value == utility::conversions::to_string_t("FIRST_AVAILABLE")) {
        return SequenceTypeEnum::FIRST_AVAILABLE;
    }
    
    if (value == utility::conversions::to_string_t("ALL_AVAILABLE")) {
        return SequenceTypeEnum::ALL_AVAILABLE;
    }
    
    throw std::invalid_argument("Invalid value for conversion to SequenceTypeEnum");
}


const utility::string_t Pack::fromSequenceTypeEnum(const SequenceTypeEnum value) const
{
    switch(value)
    {
        
        case SequenceTypeEnum::FIRST_AVAILABLE: return utility::conversions::to_string_t("FIRST_AVAILABLE");
        
        case SequenceTypeEnum::ALL_AVAILABLE: return utility::conversions::to_string_t("ALL_AVAILABLE");
        
    }
}

Pack::PackTypeEnum Pack::toPackTypeEnum(const utility::string_t& value) const
{
    
    if (value == utility::conversions::to_string_t("TUTORIAL")) {
        return PackTypeEnum::TUTORIAL;
    }
    
    if (value == utility::conversions::to_string_t("BUILTIN")) {
        return PackTypeEnum::BUILTIN;
    }
    
    if (value == utility::conversions::to_string_t("DOWNLOAD")) {
        return PackTypeEnum::DOWNLOAD;
    }
    
    if (value == utility::conversions::to_string_t("THRESHOLD")) {
        return PackTypeEnum::THRESHOLD;
    }
    
    if (value == utility::conversions::to_string_t("THEME")) {
        return PackTypeEnum::THEME;
    }
    
    if (value == utility::conversions::to_string_t("TOURNAMENT")) {
        return PackTypeEnum::TOURNAMENT;
    }
    
    throw std::invalid_argument("Invalid value for conversion to PackTypeEnum");
}


const utility::string_t Pack::fromPackTypeEnum(const PackTypeEnum value) const
{
    switch(value)
    {
        
        case PackTypeEnum::TUTORIAL: return utility::conversions::to_string_t("TUTORIAL");
        
        case PackTypeEnum::BUILTIN: return utility::conversions::to_string_t("BUILTIN");
        
        case PackTypeEnum::DOWNLOAD: return utility::conversions::to_string_t("DOWNLOAD");
        
        case PackTypeEnum::THRESHOLD: return utility::conversions::to_string_t("THRESHOLD");
        
        case PackTypeEnum::THEME: return utility::conversions::to_string_t("THEME");
        
        case PackTypeEnum::TOURNAMENT: return utility::conversions::to_string_t("TOURNAMENT");
        
    }
}


